export default function LogIn() {
  return(
    <main>
      <form className="loginForm">
        <label htmlFor="username">Username</label>
        <input type="text" name="username" required />

        <label htmlFor="password">Password (8-12 characters including at least one number, one lowercase letter, one uppercase letter, and one special character)</label>
        <input type="password" name="password" required 
    minLength="8"
    maxLength="12"
    pattern="(?=.*[0-9])(?=.*[a-zA-Z])" />

        <button type="submit">Log In</button>
      </form>
    </main>
  );
}
